const Aeapi = {
    login: (user,pass)=>{
        let username = document.getElementById(user)
        let password = document.getElementById(pass)
        let myHeaders = new Headers();
        myHeaders.append("Authorization", " undefined");
        myHeaders.append("Content-Type", " application/json;charset=UTF-8");
        myHeaders.append("Referer", " https://bo.jun88.bet/");
        myHeaders.append("Cookie", "__cf_bm=zb0egSIVLQcAdo83HGBdf.ajyZloBIT3OuRNHaF0KJA-1665478647-0-AfU1wba9fBE6xg2jqkMOF+3R0vv4l+8h2dOZd8pQVjs7qAUpkP7oBGlr5ThKGn6YHXPRTgaWpZTtFF5hLAWFzak=");

        
        let raw = JSON.stringify({
            "userid": "jun88996",
            "password": "6b18f445251c73b6f68b0026d0e5bb1fb484c1fc"
        })

        // "{\"userid\": \"jun88996\", \"password\": \"6b18f445251c73b6f68b0026d0e5bb1fb484c1fc\"}\r\n"

        let requestOptions = {
            method: 'POST',
            headers: myHeaders,
            body: raw,
            redirect: 'follow'
        };

        fetch("https://boapi.jun88.bet/jun88-ims/api/v1/login", requestOptions)
        .then(response => response.json())
        .then(result =>{
            localStorage.setItem('token',result.token)
        })
        .catch(error => console.log('error', error));
    }
}

export default Aeapi
